import React from 'react';
import '../App.css';


export default function Search(props) {    
    return(
        <div className='search-cont'>           
                <form id='form' className="form-inline">
                <input onChange={props.onChange} id='search' className="form-control mr-sm-2" type="text" placeholder="Search" aria-label="Search"/>
                <div onClick={() => props.onSearch()} id='btn' className="btn btn-outline-success my-2 my-sm-0">Search</div>
                </form>
        </div>    
    )    
}
